import supertest from 'supertest';
const request = supertest('https://gorest.co.in/public-api/');//pass the url -https://x8ki-letl-twmt.n7.xano.io/api:gHPd8le5
import {expect} from 'chai';
const Token = '78c232c1615a9801fc3fc475cb3ade16b8ee36c26fae5e598aac2d078dbd2738';

describe('Users', () =>{
    it('GET /users', () => {
        // request.get('users?acess-token=${Token}').end((err,res)=>{
        //     console.log(err);
        //     console.log(res.body);
        // });

        //a way to handle asynchronous call
        return request.get('users?acess-token=${Token}').then((res)=>{
            expect(res.body.data).to.not.be.empty;
        });
    });

    it('GET /users/:id', () =>{
        return request.get('users/273681?acess-token=${Token}').then((res)=>{
            expect(res.body.data.id).to.be.eq(273681);
            
        });
    });

    it('GET /users with query params', () =>{
        const url = 'users?acess-token=${Token}&page=5&gender=male&status=Active';
        return request.get(url).then((res)=>{
            //expect(res.body.data).to.not.be.empty;
            res.body.data.forEach((data) => {
                expect(data.page).to.eq(5);
                expect(data.gender).to.eq('male');
                expect(data.status).to.eq('active');
            });
        });
    });

    it('POST /users', () =>{
        const payload = {
            email:"abc@gmail.com",
            name: "abc",
            gender:"female",
            status:"active"
            }
        return request.post('users')
        .set("Authorization",'Bearer ${Token}')
        .send(payload)
        .then((res) => {
            console.log(res.body);
        });
    });
});

